import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';
import './Breed.css'

const Breed = () => {

    type BreedParams = {
        breed: string
    }

    const params = useParams<keyof BreedParams>() as BreedParams

    const [image, setImage] = useState<string>()
    const [breed, setBreed] = useState<string>(params.breed.split("-")[0])
    const [subBreed, setSubBreed] = useState<string>(params.breed.split("-")[1])
    const [status, setStatus] = useState<Boolean>()


    useEffect(() => {
        console.log(params)

        if(Boolean(subBreed)){
            axios.get(`https://dog.ceo/api/breed/${breed}/${subBreed}/images/random`)
            .then(res =>{
                setImage(res.data.message)
                console.log(breed)
                setStatus(true)
            })
            .catch(err => {
                console.log(err)
                setStatus(false)
            })
        }else{
            axios.get(`https://dog.ceo/api/breed/${breed}/images/random`)
            .then(res =>{
                setImage(res.data.message)
                console.log(breed)
                setStatus(true)
            })
            .catch(err => {
                console.log(err)
                setStatus(false)
            })
        }
    }, [])

    useEffect(() => {
        console.log(subBreed)
    }, [subBreed])

    return (
        <>
            {
                status ? <div className='dog-wrapper'><h1>{breed} {subBreed}</h1> <img src={image}></img></div> : <h1>Nie znaleziono pieska</h1>
            }
        </>
    );
}

export default Breed;
